import { Component, Input, Output, EventEmitter } from '@angular/core';
import { Match } from '../../../services/profile.service';

@Component({
  selector: 'app-match-card',
  template: `
    <div class="match-card" [class.liked]="isLiked" [class.passed]="isPassed">
      <div class="card-header">
        <div class="compatibility-badge">
          {{ match.compatibility }}% Match
        </div>
        <div class="distance-badge" *ngIf="match.distance">
          {{ match.distance }} mi away
        </div>
      </div>

      <div class="profile-image-container">
        <img 
          [src]="match.user.profileImage || getDefaultImage()" 
          [alt]="match.user.name"
          class="profile-image"
        >
        <div class="age-badge">{{ match.user.age }}</div>
      </div>

      <div class="card-content">
        <h3 class="profile-name">{{ match.user.name }}</h3>
        <p class="profile-info">{{ match.user.year }} • {{ match.user.major }}</p>
        <p class="profile-bio">{{ match.user.bio }}</p>

        <div class="interests" *ngIf="match.user.interests.length > 0">
          <span 
            *ngFor="let interest of match.user.interests.slice(0, 3)" 
            class="interest-tag"
          >
            {{ interest }}
          </span>
        </div>

        <div class="mutual-interests" *ngIf="match.mutualInterests.length > 0">
          <p class="mutual-label">Mutual interests:</p>
          <div class="mutual-tags">
            <span 
              *ngFor="let interest of match.mutualInterests.slice(0, 2)" 
              class="mutual-tag"
            >
              {{ interest }}
            </span>
          </div>
        </div>
      </div>

      <div class="card-actions" *ngIf="!isLiked && !isPassed">
        <button class="btn-pass" (click)="onPass()">
          <span class="icon">👎</span>
          Pass
        </button>
        <button class="btn-like" (click)="onLike()">
          <span class="icon">❤️</span>
          Like
        </button>
      </div>

      <div class="card-result" *ngIf="isLiked || isPassed">
        <div class="result-message" [class.liked]="isLiked" [class.passed]="isPassed">
          <span *ngIf="isLiked">❤️ Liked!</span>
          <span *ngIf="isPassed">👎 Passed</span>
        </div>
      </div>
    </div>
  `,
  styles: [`
    .match-card {
      background: white;
      border-radius: 20px;
      overflow: hidden;
      box-shadow: 0 10px 30px rgba(0, 0, 0, 0.1);
      transition: all 0.3s ease;
      position: relative;
    }

    .match-card:hover {
      transform: translateY(-5px);
      box-shadow: 0 20px 40px rgba(0, 0, 0, 0.15);
    }

    .card-header {
      display: flex;
      justify-content: space-between;
      padding: 1rem;
      background: linear-gradient(135deg, #667eea, #764ba2);
    }

    .compatibility-badge {
      background: rgba(255, 255, 255, 0.2);
      color: white;
      padding: 0.25rem 0.75rem;
      border-radius: 15px;
      font-size: 0.8rem;
      font-weight: 600;
    }

    .distance-badge {
      background: rgba(255, 255, 255, 0.2);
      color: white;
      padding: 0.25rem 0.75rem;
      border-radius: 15px;
      font-size: 0.8rem;
    }

    .profile-image-container {
      position: relative;
      height: 250px;
      overflow: hidden;
    }

    .profile-image {
      width: 100%;
      height: 100%;
      object-fit: cover;
    }

    .age-badge {
      position: absolute;
      bottom: 1rem;
      right: 1rem;
      background: rgba(0, 0, 0, 0.7);
      color: white;
      padding: 0.25rem 0.75rem;
      border-radius: 15px;
      font-weight: 600;
    }

    .card-content {
      padding: 1.5rem;
    }

    .profile-name {
      font-size: 1.5rem;
      font-weight: 600;
      color: #333;
      margin-bottom: 0.5rem;
    }

    .profile-info {
      color: #6c757d;
      font-size: 0.9rem;
      margin-bottom: 1rem;
    }

    .profile-bio {
      color: #555;
      line-height: 1.5;
      margin-bottom: 1rem;
    }

    .interests {
      display: flex;
      flex-wrap: wrap;
      gap: 0.5rem;
      margin-bottom: 1rem;
    }

    .interest-tag {
      background: #f8f9fa;
      color: #6c757d;
      padding: 0.25rem 0.75rem;
      border-radius: 15px;
      font-size: 0.8rem;
    }

    .mutual-interests {
      background: #e8f5e8;
      padding: 1rem;
      border-radius: 10px;
      margin-top: 1rem;
    }

    .mutual-label {
      font-size: 0.8rem;
      color: #28a745;
      font-weight: 600;
      margin-bottom: 0.5rem;
    }

    .mutual-tags {
      display: flex;
      gap: 0.5rem;
    }

    .mutual-tag {
      background: #28a745;
      color: white;
      padding: 0.25rem 0.75rem;
      border-radius: 15px;
      font-size: 0.8rem;
    }

    .card-actions {
      display: flex;
      gap: 1rem;
      padding: 1rem 1.5rem;
      background: #f8f9fa;
    }

    .btn-pass, .btn-like {
      flex: 1;
      padding: 0.75rem;
      border: none;
      border-radius: 12px;
      font-weight: 600;
      cursor: pointer;
      transition: all 0.3s ease;
      display: flex;
      align-items: center;
      justify-content: center;
      gap: 0.5rem;
    }

    .btn-pass {
      background: #e9ecef;
      color: #6c757d;
    }

    .btn-pass:hover {
      background: #dee2e6;
      transform: translateY(-2px);
    }

    .btn-like {
      background: linear-gradient(135deg, #ff6b6b, #ee5a24);
      color: white;
    }

    .btn-like:hover {
      transform: translateY(-2px);
      box-shadow: 0 8px 25px rgba(255, 107, 107, 0.3);
    }

    .card-result {
      padding: 1rem 1.5rem;
      text-align: center;
    }

    .result-message {
      font-weight: 600;
      font-size: 1.1rem;
    }

    .result-message.liked {
      color: #28a745;
    }

    .result-message.passed {
      color: #6c757d;
    }

    .match-card.liked {
      border: 2px solid #28a745;
    }

    .match-card.passed {
      border: 2px solid #6c757d;
      opacity: 0.7;
    }
  `]
})
export class MatchCardComponent {
  @Input() match!: Match;
  @Input() index!: number;
  @Output() like = new EventEmitter<Match>();
  @Output() pass = new EventEmitter<Match>();

  isLiked = false;
  isPassed = false;

  onLike() {
    this.isLiked = true;
    this.like.emit(this.match);
  }

  onPass() {
    this.isPassed = true;
    this.pass.emit(this.match);
  }

  getDefaultImage(): string {
    const images = [
      'https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d?w=400',
      'https://images.unsplash.com/photo-1494790108755-2616b612b786?w=400',
      'https://images.unsplash.com/photo-1500648767791-00dcc994a43e?w=400',
      'https://images.unsplash.com/photo-1438761681033-6461ffad8d80?w=400'
    ];
    return images[this.index % images.length];
  }
}
